!function(){const t=document.getElementById("filter-by-period"),n=document.getElementById("filter-by-start_date"),d=document.getElementById("filter-by-end_date");t&&t.addEventListener("change",()=>{var e="custom"!==t.value;n.disabled=e,d.disabled=e}),n&&n.addEventListener("change",()=>{d.min=n.value}),d&&d.addEventListener("change",()=>{n.max=d.value||(new Date).toISOString().split("T")[0]})}();